import React from 'react'
import { quantity } from './Home'
import { useContext } from 'react'
import Cartitems from './Cartitems'
import { Route ,Routes,NavLink } from 'react-router-dom'

import { price } from './Home'
import { quantity2 ,quantity3} from './Home'


export default function Navbar() {
  

   //useContext hook can be used to fetch data of context 
  return (
    <div>
        <nav className="navbar bg-body-tertiary">
  <div className="container-fluid">
    <a className="navbar-brand" href="#">
      <img src="logo-color.png" alt="Logo" width="150" height="80" className="d-inline-block align-text-top"/> 
    </a>

   <div>

    <quantity.Consumer>
   {
      (data)=>{

        return (

            <quantity2.Consumer>
                {
                      (data2)=>{
                        return
                        
                        (
                            <quantity3.Consumer>

                               {
                                (data3)=>{
                                 return (
<h6 style={{background:'orange',width:'2rem',borderRadius:'50%'}}>{data+data2+data3}</h6>
                                 )
                                }

                               }
                            </quantity3.Consumer>
                            

                        )
                      }
                }

            </quantity2.Consumer>

        )
      }
   }

    </quantity.Consumer>

   
   
  <img src='cart.gif' width="120" height="80" />
  </div> 

  </div>
</nav>
      
    </div>
  )
}
